CREATE TABLE areas (
  idarea varchar(30) NOT NULL default '',
  nombrearea varchar(40) default NULL,
  PRIMARY KEY  (idarea)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE asigna (
  idequipo varchar(15) NOT NULL,
  fecha date NOT NULL,
  clave varchar(15) NOT NULL,
  area varchar(15) default NULL,
  observacion varchar(50) default NULL,
  `status` int(11) default NULL,
  fechafin date default NULL,
  PRIMARY KEY  (idequipo,clave,fecha)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE aula (
  ida int(11) NOT NULL,
  aula varchar(10) default NULL,
  PRIMARY KEY  (ida)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



CREATE TABLE carrera (
  idcar varchar(20) NOT NULL,
  descar varchar(100) NOT NULL,
  `status` tinyint(4) default NULL,
  PRIMARY KEY  (idcar)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



CREATE TABLE control (
  id int(11) NOT NULL,
  des varchar(50) NOT NULL,
  opcion int(11) NOT NULL,
  PRIMARY KEY  (id)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE controlmantenimiento (
  idcont int(11) NOT NULL,
  descrip varchar(100) NOT NULL,
  valor int(11) default NULL,
  PRIMARY KEY  (idcont)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



CREATE TABLE coordina (
  idcor varchar(10) NOT NULL,
  idcar varchar(20) NOT NULL,
  PRIMARY KEY  (idcor,idcar),
  KEY idcar (idcar)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE coordinador (
  idcor varchar(10) NOT NULL,
  nomcor varchar(60) default NULL,
  passcor varchar(40) default NULL,
  dircor varchar(60) default NULL,
  telcor varchar(15) default NULL,
  mailcor varchar(40) default NULL,
  PRIMARY KEY  (idcor)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



CREATE TABLE cursa (
  idh int(11) NOT NULL,
  matricula varchar(9) NOT NULL,
  opor int(11) NOT NULL default '0',
  fecing date default NULL,
  asigna varchar(10) default NULL,
  eval int(11) default NULL,
  po1 float default NULL,
  so1 float default NULL,
  po2 float default NULL,
  so2 float default NULL,
  po3 float default NULL,
  so3 float default NULL,
  po4 float default NULL,
  so4 float default NULL,
  po5 float default NULL,
  so5 float default NULL,
  po6 float default NULL,
  so6 float default NULL,
  po7 float default NULL,
  so7 float default NULL,
  po8 float default NULL,
  so8 float default NULL,
  po9 float default NULL,
  so9 float default NULL,
  deser int(11) default NULL,
  prom float default NULL,
  PRIMARY KEY  (idh,matricula,opor),
  KEY idh (idh,matricula),
  KEY matricula (matricula),
  KEY opor (opor)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




